import React from "react";
import "./navBar.css";

const navBar = () => {
  return (
    <section id="navBar">
      <a className="navText">Home</a>
      <a className="navText">Guide</a>
      <a className="navText">Tournament</a>
      <button>
        <a>Tournament</a>
      </button>
      <button>
        <a>Tournament</a>
      </button>
    </section>
  );
};

export default navBar;
